import CreateDeckForm from "./CreateDeckForm";

function NewDeckView({formData, createNewDeckForm}){

    return (
        <>
          <h2>Deck</h2>
          <ul>
            {formData.map((currentValue, index) => (
                <CreateDeckForm 
                createNewDeckForm={() => createNewDeckForm()}
                key={index}
                currentValue={currentValue}
                />
              ))}
          </ul>
        </>
      );


}

export default NewDeckView;
